\":\"Ensures headings have discernible text\",\"help\":\"Headings must not be empty\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/empty-heading?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"frame-tested\",\"impact\":null,\"tags\":[\"cat.structure\",\"review-item\",\"best-practice\"],\"description\":\"Ensures <iframe> and <frame> elements contain the axe-core script\",\"help\":\"Frames must be tested with axe-core\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/frame-tested?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"frame-title-unique\",\"impact\":null,\"tags\":[\"cat.text-alternatives\",\"best-practice\"],\"description\":\"Ensures <iframe> and <frame> elements contain a unique title attribute\",\"help\":\"Frames must have a unique title attribute\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/frame-title-unique?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"frame-title\",\"impact\":null,\"tags\":[\"cat.text-alternatives\",\"wcag2a\",\"wcag241\",\"wcag412\",\"section508\",\"section508.22.i\"],\"description\":\"Ensures <iframe> and <frame> elements contain a non-empty title attribute\",\"help\":\"Frames must have title attribute\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/frame-title?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"heading-order\",\"impact\":null,\"tags\":[\"cat.semantics\",\"best-practice\"],\"description\":\"Ensures the order of headings is semantically correct\",\"help\":\"Heading levels should only increase by one\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/heading-order?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"input-button-name\",\"impact\":null,\"tags\":[\"cat.name-role-value\",\"wcag2a\",\"wcag412\",\"section508\",\"section508.22.a\"],\"description\":\"Ensures input buttons have discernible text\",\"help\":\"Input buttons must have discernible text\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/input-button-name?application=axe-puppeteer\",