viewport-large?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"meta-viewport\",\"impact\":null,\"tags\":[\"cat.sensory-and-visual-cues\",\"best-practice\"],\"description\":\"Ensures <meta name=\\\"viewport\\\"> does not disable text scaling and zooming\",\"help\":\"Zooming and scaling must not be disabled\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/meta-viewport?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"object-alt\",\"impact\":null,\"tags\":[\"cat.text-alternatives\",\"wcag2a\",\"wcag111\",\"section508\",\"section508.22.a\"],\"description\":\"Ensures <object> elements have alternate text\",\"help\":\"<object> elements must have alternate text\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/object-alt?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"role-img-alt\",\"impact\":null,\"tags\":[\"cat.text-alternatives\",\"wcag2a\",\"wcag111\",\"section508\",\"section508.22.a\"],\"description\":\"Ensures [role=\'img\'] elements have alternate text\",\"help\":\"[role=\'img\'] elements have an alternative text\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/role-img-alt?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"scope-attr-valid\",\"impact\":null,\"tags\":[\"cat.tables\",\"best-practice\"],\"description\":\"Ensures the scope attribute is used correctly on tables\",\"help\":\"scope attribute should be used correctly\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/scope-attr-valid?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"scrollable-region-focusable\",\"impact\":null,\"tags\":[\"wcag2a\",\"wcag211\"],\"description\":\"Elements that have scrollable content should be accessible by keyboard\",\"help\":\"Ensure that scrollable region has keyboard access\",\"helpUrl\":\"https://dequeuniversity.com/rules/axe/3.5/scrollable-region-focusable?application=axe-puppeteer\",\"nodes\":[]},{\"id\":\"server-side-image-map\",\"impact\":null,\"tags\":[\"cat.text-alternatives\",\"wcag2a\",\"wcag211\",\"section508\",\